import React, { useState } from 'react';
import './tiktak.css';
import { render } from '@testing-library/react';

function handleClick(i) {

}
function Board() {
  const status = "next player: X";
  const [gameState, setGameState] = Array(9).fill(null);
  function renderSquare(i) {
    return <Square val={gameState[i]} onClick={handleClick(i)} />
  }
  return (
    <div>
      <div className="status">{status}</div>
      <div class="board-row">
        {renderSquare(0)}
        {renderSquare(1)}
        {renderSquare(2)}
      </div>
      <div class="board-row">
        {renderSquare(3)}
        {renderSquare(4)}
        {renderSquare(5)}
      </div>
      <div class="board-row">
        {renderSquare(6)}
        {renderSquare(7)}
        {renderSquare(8)}
      </div>
    </div>
  );

}
function Square(props) {
  // const [displayed, setDisplyed] = useState("");
  return (
    <button class="square" onClick={props.onClick}>{props.val}</ button>
  );

}
function Tiktak() {

  return (
    <div>
      <h2>Tiktak</h2>
      <div class="game-board">
        <Board />
      </div>
      <div class="game-info">
        <div>{}</div>
      </div>
    </div>
  )
}


export default Tiktak;
